import './App.css';
import NavBar from './Components/NavBar';

function App() {
  return (
    <>
      <Navbar />
      <div>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/Instructor" element={<Instructor />} />
          <Route path="/Student" element={<Student />} />
        </Routes>
      </div>
    </>

  );
}

export default App;
